('1', 'Drupal news', 'https://www.drupal.org/node/feed', '3600', '1422457970', '0', 'https://www.drupal.org', 'Come for the software, stay for the community\nDrupal is an open source content management platform powering millions of websites and applications. It’s built, used, and supported by an active and diverse community of people around the world.', '', 'ffc85660c2ae8c611e72f7097e3e9c3b777e7c6d0bce8fe9e80d1b21f0f3eaad', '"1422175805-1"', '1422175805', '5');
INSERT INTO `aggregator_item` VALUES
('1', '1', 'Michael Hess new Security Team Lead', 'https://www.drupal.org/node/2151461', 'Dries', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>Back in November of 2011, I appointed <a href="https://drupal.org/node/1341738" rel="nofollow">Greg Knaddison</a> to lead the <a href="https://drupal.org/security-team" rel="nofollow">Drupal Security Team</a>, for a term of two years. In that time, Greg has done a tremendous job helping the Security Team scale. November 2013 ends the term that Greg and I agreed to, Greg is now stepping down as team lead. </p>\n<p>I''m pleased to share that Michael Hess (<a href="https://drupal.org/user/102818" rel="nofollow">mlhess</a> on Drupal.org) has accepted my invitation to become the new Security Team lead.  For those who don''t know Michael, he is an adjunct lecturer and a Solution Architect Lead at the University of Michigan. He teaches courses on content management platforms, particularly focusing on  Drupal, oversees the functionality of several campus websites, and serves in a consulting and development role for other departments within the University of Michigan. He has been a member of the Drupal Security Team for 3 years and a member of the infrastructure team for 2 year.  </p>\n<p>As the Drupal Security Team lead, Michael will be the point person for the team.  He''ll be responsible for coordinating the Security Team''s activities and for making decisions when consensus doesn''t arise. Michael wants to move the team into more of an advisory and preemptive role, rather than a response function. In addition, he wants to continue to scale the security team (e.g. by working on building better and more automated tools, providing better metrics, etc).</p>\n<p>Please join me in thanking Greg for all the great work he has done over the past two years, and in welcoming Michael as the new team lead!</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/902">Drupal News</a></div></div></div>', '1386688593', '2151461 at https://www.drupal.org'),
('2', '1', 'Drupal 6 to stop supporting PHP 4 on March 1st 2014', 'https://www.drupal.org/node/2159315', 'Gábor Hojtsy', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p><a href="https://drupal.org/drupal-6.0" rel="nofollow">Drupal 6.0 was released almost 6 years ago</a> in February 2008. The Drupal community is committed to release Drupal 6 bugfixes until Drupal 8.0 is released and <a href="https://drupal.org/comment/8273013#comment-8273013" rel="nofollow">with recent changes provide security fixes much longer</a>. </p>\n<p>The hosting and development landscape was very different in 2008 though. PHP has gone a long way since we released Drupal 6. While Drupal 6 is still supported on PHP 4.x, the PHP developer community itself <a href="http://php.net/eol.php" rel="nofollow">end-of-lifed PHP 4 just half a year after Drupal 6.0 came out</a>. According to public statistics and data available to us about Drupal 6 sites, we estimate that there is a very small number of Drupal sites which may still run on PHP 4. We also don''t believe it is in our best interest to support Drupal 6 on a possibly insecure but definitely unsupported base system, so we <a href="https://drupal.org/node/2140113" rel="nofollow">discussed and decided</a> to <strong>drop support for PHP 4 on March 1st 2014</strong>.</p>\n<p>If you are running a Drupal 6 site on PHP 4.x, we suggest you look at your hosting situation as it is likely there are other outdated (and possibly insecure) components involved in your environment as well. For the secure operations of your site, we suggest you look at other hosting options. We suggest to look for hosting with at least PHP 5.2.4 (same as Drupal 7''s oldest supported PHP version).</p>\n<p>While we don''t plan to deliberately introduce PHP 5 constructs in Drupal 6, this change also lets contributed module developers to use PHP 5 more easily in their code.</p>\n<!--break--></div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/902">Drupal News</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/102">Drupal 6.x</a></div></div></div>', '1387386075', '2159315 at https://www.drupal.org'),
('3', '1', 'Drupal Association is hiring CTO', 'https://www.drupal.org/node/2161971', 'tvn', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>The Drupal Association, with the help of a Search Committee comprised of Board and Advisory Board members, is beginning a search for a Chief Technical Officer (CTO) for Drupal.org (not the Drupal software project). The CTO will fill a critical role for the both the Association and the community, working at the strategic level with the Drupal.org Working Groups to build a roadmap for Drupal.org, create and manage processes critical to the success of the site (including security and disaster recovery), and ensure that Drupal.org roadmaps are met. A CTO role ensures that Drupal.org has the technical and strategic oversight needed to drive improvements and innovations. Specifically we want to ensure that we have the best platform for developers, community involvement, and critical revenue-generating opportunities.</p>\n<p>The CTO is the first of several hires we will make over the course of the next few months to significantly increase our ability to improve the experience of Drupal.org for our many constituents. These hires will include more development and devops bandwidth, among other things. In short, this is a really exciting time to work on Drupal.org!</p>\n<p>We''re asking for your help to find the right person for this role. We''re looking for someone with strong product management skills, a community player who can work with our broad base of remarkable volunteers, and the experience to guide and manage our development, infrastructure and operations teams. Please review and share the <a href="https://association.recruiterbox.com/jobs/25890" rel="nofollow">Drupal Association CTO Job Description</a>.</p>\n<p>We''ve also included a little more context below if you want to learn more. And, if you have any questions, please feel free to <a href="mailto:holly@association.drupal.org?subject=CTO%20Search%20Post" rel="nofollow">contact Holly Ross</a>.</p>\n<h3>\n	Why a CTO? Isn’t that a bit much for our needs?</h3>\n<p>Our focus at the Association in 2013 has been re-aligning Association resources to bring more support and funding to our community’s most important asset: Drupal.org. During the last 9 months, we''ve begun diversifying our revenue streams so that we can scale our income and provide more funding for Drupal.org projects. We launched Working Groups to manage the strategic direction and policy setting we need to make good decisions for the site. Most recently, we hired a Technology Manager for the Association so that our limited technical staff can focus more fully on Drupal.org.</p>\n<p>In 2014, we are planning for an even more dramatic shift, bringing on engineering and infrastructure staff to pay off years of technical debt and begin to move the site forward with new developer tools, better site performance, and strong security practices. We’re incredibly excited to help the community move Drupal.org forward and really meet community needs. We see the CTO role as essential to making this happen. It sets us up to proactively address Drupal.org needs at a strategic level - forecasting necessary changes before they become critical problems.</p>\n<h3>\n	Isn’t this the role of the Working Groups?</h3>\n<p>Yes - the Working Group charters put them in charge of direction-setting and strategy for the sites. We anticipate that the CTO will work closely with the Working Groups to coordinate their work and ensure that those decisions are translated into a cohesive roadmap. Additionally, the Working Groups are not designed to implement the roadmap. The CTO will oversee the team that does that - either in-house, using 3rd party tools, through contractors, with volunteers, or a combination of these options.</p>\n<h3>\n	Are you going to hire from within the community?</h3>\n<p>We are certainly going to look within the community. We will also look outside the Drupal community. The committee seeks a candidate who brings a breadth of experience and knowledge regarding open source community sites.</p>\n<h3>\n	Is this a technical role or a business role?</h3>\n<p>We expect that the right candidate will have equal parts technical chops and business savvy. We are not expecting the CTO to write production code, but the CTO will have to know how to do that so that they can manage it well. Additionally, the CTO will need to understand business problems and how technology can be strategically deployed to meet those needs.</p>\n<h3>\n	Where will the position be based?</h3>\n<p>Ideally, in Portland, OR, at the Drupal Association headquarters. We know however, that this is likely unrealistic as a hard and fast constraint, and will encourage applicants from around the globe.</p>\n</div></div></div>', '1388346412', '2161971 at https://www.drupal.org'),
('4', '1', 'Drupal 7.25 released', 'https://www.drupal.org/drupal-7.25', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;"><em>Update: <a href="/drupal-7.26">Drupal 7.26</a> is now available.</em></p>\n<p style="position: inherit;">Drupal 7.25, a maintenance release with numerous bug fixes (no security fixes) is now available for download. See the <a href="http://drupal.org/drupal-7.25-release-notes">Drupal 7.25 release notes</a> for a full listing.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.25.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.25</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 sites is recommended.</strong> There are no major new features in this release. For more information about the Drupal 7.x release series, consult the <a href="http://drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 includes the built-in Update Manager module, which informs you about important updates to your modules and themes.</p>\n<p>There are no security fixes in this release of Drupal core.</p>\n<h2>Bug reports</h2>\n<p>Drupal 7.x is being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>), more maintenance releases will be made available, according to our <a href="http://drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.25 contains bug fixes and small API/feature improvements only. The full list of changes between the 7.24 and 7.25 releases can be found by reading the <a href="http://drupal.org/drupal-7.25-release-notes">7.25 release notes</a>. A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<h2>Update notes</h2>\n<p>See the <a href="http://drupal.org/drupal-7.25-release-notes">7.25 release notes</a> for details on important changes in this release.</p>\n<h2>Known issues </h2>\n<p>Changes to Drupal''s page caching system in this release caused an incompatibility with the <a href="https://drupal.org/project/authcache">Authcache</a> module (see <a href="https://drupal.org/node/2172421">this issue</a>).  The solution is to upgrade to <a href="https://drupal.org/node/2173925">Authcache 7.x-1.7</a> or higher.</p>\n<div style="clear: both; height: 1em;"></div>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1388710112', '2166153 at https://www.drupal.org'),
('5', '1', 'Predictions for 2014', 'https://www.drupal.org/node/2173123', 'bertboerland', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p><a href="https://drupal.org/node/4877" rel="nofollow">4877</a>. That is where the tradition within the Drupal community of making predictions for the year ahead with regards to our software, our community and broader, the web, started. Node 4877, written at the end of the year 2003. We have come a long way since then.</p>\n<p>This year we would like to know what you think the year ahead will bring for Drupal and, as a bonus, we would like to know what was the best prediction you found in the past. Where did we shine when it comes to vision or humor. </p>\n<p>See older entries from <a href="https://drupal.org/node/14784" rel="nofollow">2005</a>, <a href="https://drupal.org/node/41966" rel="nofollow">2006</a>, <a href="https://drupal.org/node/105423" rel="nofollow">2007</a>, <a href="https://drupal.org/node/204454" rel="nofollow">2008</a>, <a href="https://drupal.org/node/356251" rel="nofollow">2009</a>, <a href="https://drupal.org/node/671566" rel="nofollow">2010</a>, <a href="https://drupal.org/node/1028810" rel="nofollow">2011</a>, <a href="https://drupal.org/node/1399054" rel="nofollow">2012</a> and  <a href="https://drupal.org/node/1881074" rel="nofollow">2013</a>. Read them. </p>\n<p>And now predict for 2014 and reflect the last decade in this thread.</p>\n</div></div></div>', '1389691613', '2173123 at https://www.drupal.org'),
('6', '1', 'Drupal 7.26 and 6.30 released', 'https://www.drupal.org/drupal-7.26', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;"><em>Update: <a href="/drupal-7.27">Drupal 7.27</a> and <a href="/drupal-7.27">Drupal 6.31</a> are now available.</em></p>\n<p style="position: inherit;">Drupal 7.26 and Drupal 6.30, maintenance releases which contain fixes for <strong>security vulnerabilities</strong>, are now available for download. See the <a href="http://drupal.org/drupal-7.26-release-notes">Drupal 7.26</a> and <a href="http://drupal.org/drupal-6.30-release-notes">Drupal 6.30</a> release notes for further information.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.26.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.26</span></a><br /><a href="http://ftp.drupal.org/files/projects/drupal-6.30.tar.gz" class="link-button"><span>Download Drupal 6.30</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 and 6 sites is strongly recommended.</strong> There are no new features or non-security-related bug fixes in these releases. For more information about the Drupal 7.x release series, consult the <a href="http://drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>. More information on the Drupal 6.x release series can be found in the <a href="http://drupal.org/drupal-6.0">Drupal 6.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 and 6 include the built-in Update Status module (renamed to Update Manager in Drupal 7), which informs you about important updates to your modules and themes.</p>\n<h2>Bug reports</h2>\n<p>Both Drupal 7.x and 6.x are being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>) more maintenance releases will be made available, according to our <a href="http://drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.26 is a security release only. For more details, see the <a href="http://drupal.org/drupal-7.26-release-notes">7.26 release notes</a>.  A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<p>Drupal 6.30 is a security release only. For more details, see the <a href="http://drupal.org/drupal-6.30-release-notes">6.30 release notes</a>.  A complete list of all bug fixes in the stable 6.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/6.x">the git commit log</a>.</p>\n<h2>Security vulnerabilities</h2>\n<p>Drupal 7.26 and 6.30 were released in response to the discovery of security vulnerabilities. Details can be found in the official security advisory:</p>\n<ul><li><a href="http://drupal.org/SA-CORE-2014-001">SA-CORE-2014-001</a></li>\n</ul><p>To fix the security problem, please upgrade to either Drupal 7.26 or Drupal 6.30.</p>\n<h2>Known issues </h2>\n<p>(Drupal 7 only) On sites with a very large number of unpublished nodes in the database, the Taxonomy module update function introduced in this release may take a very long time to run and consume an excessive amount of memory; see <a href="https://drupal.org/node/2174551">this issue</a>.  The solution is to upgrade directly to <a href="https://drupal.org/drupal-7.28">Drupal 7.28</a> instead.</p>\n<div style="clear: both; height: 1em;"></div>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/102">Drupal 6.x</a></div><div class="field-item odd"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1389815989', '2174413 at https://www.drupal.org'),
('7', '1', 'Joining The Day We Fight Back', 'https://www.drupal.org/node/2188053', 'Crell', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>Free Software is not just about saving money.  It''s not just about sharing for sharing''s sake.  Free Software, at its core, is about empowering people.  It is about ensuring that everyone has ultimate control over their own electronic lives, because the software that runs their electronic lives is under their control and not someone else''s.</p>\n<p>How do you know your computer is doing what you tell it to, and not someone else?  How do you know your phone is only recording what you tell it to record?  How do you know your files are only being read by you?  How do you know your refrigerator isn''t reporting on your diet to someone else?</p>\n<p>The only way to be sure is to have the source code so that you or someone you trust can verify that it is doing only what you tell it to and your electronic tools are not secretly acting for someone else.  Free Software is all about ensuring an individual''s personal digital sovereignty, free from unwanted or secret invasion from anyone -- other people, corporations, or governments.</p>\n<p>The entire point of sharing source code is so that individual people and organizations can ultimately have control over their own equipment, information, and digital lives. In many ways it is about privacy: The security to know that your data is accessible to you, and your computer is used by you, and only you, unless you decide otherwise.</p>\n<p>Recent revelations, however, have shown that people''s digital sovereignty is under even more attack than before.  Both the American and British governments have been found violating the digital privacy of millions of people in their own countries and around the world.  That is exactly the sort of attack on individual digital sovereignty that Free Software was created to combat.</p>\n<p>As a leading Free Software project, the Drupal Community opposes such privacy invasions.  We believe it is our ethical duty to stand with <a href="https://thedaywefightback.org/" rel="nofollow">The Day We Fight Back</a> and others who oppose such violations of individual digital sovereignty.  We encourage all people, all over the world, to take a stand for digital freedom.  If you are in the United States you can use the banner at the bottom of this page to locate and contact your Congressional representatives and tell them to oppose further infringement of individual privacy rights and to force the NSA and similar agencies to obey the law in both letter and spirit.</p>\n</div></div></div>', '1392074413', '2188053 at https://www.drupal.org'),
('8', '1', 'Community Spotlight: Lee Rowlands (larowlan)', 'https://www.drupal.org/node/2217905', 'leighc', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p><img class="right" src="/files/leerowlands_0.png" alt="Lee Rowlands" />Since joining Drupal.org in 2007, Lee Rowlands (<a href="https://drupal.org/user/395439" rel="nofollow">larowlan</a>) has been an important contributor to the Drupal project. A major core contributor and Drupal 8 advocate, Rowlands has become a well-recognized and celebrated member of the Drupal community. </p>\n<p>Rowlands is an important Drupal figure in Australia, and has spoken at DrupalCamp Brisbane 2010, Drupal Downunder Melbourne 2012, DrupalCon Sydney 2013 and Drupal South Wellington 2014. An occasional mentor during Drupal Office Hours in the Australian timezone (GMT+10), Rowlands is also a well-recognized figure in the international Drupal community for his involvement with core and his contributions to a huge variety of projects on Drupal.org.</p>\n<h3>How did you get involved with Drupal?</h3>\n<p>Jim Morrison and a naked native american came to me in a dream and told me it was my destiny. Just kidding. I started up my own IT consulting business and I''d built a couple of Drupal 5 sites. </p>\n<p>The third site I built needed some tricky mapping functionality. This was in Drupal 5 and the site was for a locally owned fishing tackle franchise. Their point of difference with the big national chain-store was local knowledge. So they had this great idea to create a series of online fishing maps for local regions, each featuring points of interest for that region. Each point of interest had a marker icon based on its type, eg there were boat ramps, fishing spots etc. Each marker had a popup with an image and some text. The kind of thing you can build on your own with Google Maps now, but back then - it was a fairly new concept. </p>\n<p>At the time gmap module was the go-to mapping option (Drupal 5) but it didn''t support the image/marker/description functionality. So I wrote a patch to allow wiring up a content-type with gmap functionality to do so. And in order to post the patch, I had to sign up for a Drupal.org account. So that was my first comment on Drupal.org, a sizeable patch!</p>\n<p>Not long after that I pitched the idea of a website to a local motel that had just had a renovation. At this stage Drupal 6 was out and the go-to ecommerce solution was Ubercart. My pitch included online-reservations so I worked with Will Vincent to round out a hotel-booking solution for Ubercart. That''s how I got my CVS access on Drupal.org. </p>\n<p>Contributing my code back to Drupal.org opened my consulting business up to the world. Up until that point most of my work had been for local businesses. Once I had a project on Drupal.org I started receiving work offers via my Drupal.org project page, mostly for adding new pieces of functionality.</p>\n<p>I continued building sites and I always ensured that I had contract provisions to open-source any generic modules that the project needed. Over time I ended up with more than 30 contrib projects on Drupal.org, all with varying degrees of maintenance. Each of these kept resulting in work referrals and I kept expanding my skillset and client-base.</p>\n<p>Then Drupal 7 came out and it felt like I had to start learning all over again. I had a long car-trip coming up so I downloaded the mega ''Upgrading 6.x modules to 7.x'' thread from Drupal.org and spent about three hours taking in all the changes. As soon as I had net access, I subscribed to the Drupal core issues RSS feed. At this stage my motivation was just to keep across changes happening in core, but after a while I started seeing issues posted that I realised I could fix/work on. So I started commenting and posting the odd patch. </p>\n<p>Not long after an epic thread was posted by @sun in the issue queue titled ''Make core maintainable'' (<a href="https://drupal.org/node/1255674">https://drupal.org/node/1255674</a>), basically it was proposing that if we didn''t get more hands on deck in core, the only way forward was to start dropping unmaintained modules. I jumped into irc and put my hand up to maintain forum, one of the modules on the chopping block. I had a conversation with @chx who later remarked ''yesterday I saw a guy on IRC who was contemplating on taking the forum module maintainer hat'' (<a href="http://www.drupal4hu.com/node/303">http://www.drupal4hu.com/node/303</a>). </p>\n<p>So from there I took a more active role in core contribution. Those threads are a great read, even today, as they indicates the level of frustration that core developers were experiencing in the first six months of Drupal 7''s release. </p>\n<h3>What do you do with Drupal these days?</h3>\n<p>I build sites for some of Australia''s largest government, education, media and non-profit organisations with one of Australia''s most respected Drupal Agencies, PreviousNext. It''s a great team and I get to work on interesting projects. </p>\n<p>After all this time I still enjoy working with Drupal. Sometimes people lament Drupal''s ease of site-building, likening it to ''golden handcuffs'', but that''s where contributing to core and contrib help. If you find yourself stuck in a ''click-monkey'' rut, contributing code lets you flex your ''code-monkey'' muscles.</p>\n<h3>You’re involved with quite a variety of projects in the Drupal community  - can you describe some of the things you do and why you like them?</h3>\n<p>I particularly like working on Drupal core because it helps me keep abreast of upcoming changes. I don''t have a CS education, I have degrees in mathematics and engineering, and I''ve been quoted before saying I got my CS education in the Drupal issue queues. As a contributor you are incredibly lucky to have your work constructively reviewed by some of the world''s best programmers. Every time someone makes a suggestion on your patch, you learn a little more. I''ve learnt so many programming concepts from reviewing other''s code and having my code reviewed by others. Particularly during the Drupal 8 cycle, where we''ve effectively rewritten Drupal in a new language - PHP 5.3.</p>\n<h3>What’s the coolest project you’ve worked on?</h3>\n<p>Its not live anymore unfortunately but I worked on sendmypostcards.com which was a Drupal 6 site with Ubercart where you could create your own postcards and pay to have them printed. You could use your Facebook photo-galleries, Flickr account or upload your own files. The designer/editor was built with jQuery and the site used batch-jobs to generate 300dpi print-ready PDFs. It was a challenging project but it did end up spawning a number of contrib modules including Image Cache External which allows you to generate derivatives of remote images. Unfortunately the site didn''t last, but I did get a couple of Christmas cards printed and sent to my office. It was great to have something tangible, I still have them mounted on my office wall.</p>\n<h3>What changes do you hope will come in Drupal 8?</h3>\n<p>I''m disappointed we didn''t get a layout builder in core but I''m excited by the opportunities for it to develop and mature in the contrib ecosystem. Some of the work done as part of the Scotch Initiative by @sdboyer and @eclipsegc was pretty awesome. @sdboyer stepped me through the ''Princess'' branch (the name was a dare) at the stage when it was fairly functional and the possibilities it opened up were pretty awesome. Hopefully that work will be leveraged for what becomes of panels/page manager in Drupal 8.</p>\n<h3>What is your favorite part about the Drupal community?</h3>\n<p>Getting to work with insanely intelligent and brilliant people. There are so many awesome people working with and on Drupal every day who are always willing to share their experiences and knowledge.</p>\n<h3>Tell us a little about your background or things that interest you outside Drupal?</h3>\n<p>I live in Central Queensland at the Southern tip of Australia''s Great Barrier Reef. We have three World Heritage listed destinations all within our reach - the reef, Fraser Island and Mon Repos Turtle Rookery, where you can watch Marine turtles lay their eggs or the hatchlings make their way into the world. The climate is great, the cost of living is low and the people are some of the friendliest in the world. I get to work out of an office with two great Drupal devs who also work for PreviousNext, @nick_schuch and @grom385. Its a great lifestyle, our office is right on the beach.</p>\n<p>Outside Drupal I''m passionate about family, with two school aged children and I''ve been married for 15 years. I''m lucky that Drupal gave me an income while my children were pre-school aged and when they went off to school I was able to turn this into a career.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/20236">Drupal 8.x</a></div></div></div>', '1394808302', '2217905 at https://www.drupal.org'),
('9', '1', 'Drupal.org Response to Heartbleed Security Incident', 'https://www.drupal.org/news/2014-04-08-security-update', 'joshuami', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>You may have heard that a vulnerability in the OpenSSL cryptographic library called Heartbleed or formally called CVE-2014-0160 has been disclosed and that it represents a potential security threat to a large number of websites. Using this vulnerability, malicious individuals could access sensitive information submitted by people actively visiting a website including usernames, passwords and credit card numbers. Users across the Internet should be especially aware of suspicious activity on their accounts.</p>\n<p>We want to communicate a couple pieces of information about this news with regard to Drupal.org. </p>\n<p>Members of the Drupal Association staff, Drupal Security Team and Drupal Infrastructure Team have reviewed Drupal.org''s potential exposure to the vulnerability. </p>\n<p>As of now, we have no indication that Drupal.org was attacked using this vulnerabililty. That said, the nature of the vulnerability makes an attack difficult to detect and we prefer to be cautious. </p>\n<p>We have taken steps to protect users of Drupal.org, including a forced password reset for users with administrative access or access to code repositories for projects. While we have only forced the password reset for some users, we recommend that all of our users change their passwords.</p>\n<p>We have taken the following steps to protect Drupal.org account holders:</p>\n<ul><li>Installed new SSL certificates based on a new private key</li>\n<li>Revoked the old SSL certificates</li>\n<li>Replaced the private strings (drupal_private_key and drupal_hash_salt) which are used for a variety of security related purposes in all Drupal sites</li>\n<li>Replaced the private key used by the “bakery” single-sign-on system on Drupal.org</li>\n<li>Removed all active sessions</li>\n<li>Verified the email addresses in use today match those in use a week ago</li>\n<li><strong>Required that all Drupal.org users with administrative or project repository access to reset their passwords</strong></li>\n</ul><p>Also, we simply want to help create awareness about the vulnerability and encourage people to review their sites for exposure. For more information, please see <a href="https://web.nvd.nist.gov/view/vuln/detail?vulnId=CVE-2014-0160">https://web.nvd.nist.gov/view/vuln/detail?vulnId=CVE-2014-0160</a></p>\n<p>Feel free to comment on the post with any questions. Thank you!</p>\n</div></div></div>', '1396996574', '2236343 at https://www.drupal.org'),
('10', '1', 'Drupal 7.27 and 6.31 released', 'https://www.drupal.org/drupal-7.27', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;"><em>Update: <a href="/drupal-7.28">Drupal 7.28</a> and <a href="/drupal-7.29">Drupal 6.32</a> are now available.</em></p>\n<p style="position: inherit;">Drupal 7.27 and Drupal 6.31, maintenance releases which contain fixes for <strong>security vulnerabilities</strong>, are now available for download. See the <a href="http://drupal.org/drupal-7.27-release-notes">Drupal 7.27</a> and <a href="http://drupal.org/drupal-6.31-release-notes">Drupal 6.31</a> release notes for further information.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.27.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.27</span></a><br /><a href="http://ftp.drupal.org/files/projects/drupal-6.31.tar.gz" class="link-button"><span>Download Drupal 6.31</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 and 6 sites is strongly recommended.</strong> There are no new features or non-security-related bug fixes in these releases. For more information about the Drupal 7.x release series, consult the <a href="http://drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>. More information on the Drupal 6.x release series can be found in the <a href="http://drupal.org/drupal-6.0">Drupal 6.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 and 6 include the built-in Update Status module (renamed to Update Manager in Drupal 7), which informs you about important updates to your modules and themes.</p>\n<h2>Bug reports</h2>\n<p>Both Drupal 7.x and 6.x are being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>) more maintenance releases will be made available, according to our <a href="http://drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.27 is a security release only. For more details, see the <a href="http://drupal.org/drupal-7.27-release-notes">7.27 release notes</a>.  A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<p>Drupal 6.31 is a security release only. For more details, see the <a href="http://drupal.org/drupal-6.31-release-notes">6.31 release notes</a>.  A complete list of all bug fixes in the stable 6.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/6.x">the git commit log</a>.</p>\n<h2>Security vulnerabilities</h2>\n<p>Drupal 7.27 and 6.31 were released in response to the discovery of security vulnerabilities. Details can be found in the official security advisory:</p>\n<ul><li><a href="http://drupal.org/SA-CORE-2014-002">SA-CORE-2014-002</a></li>\n</ul><p>To fix the security problem, please upgrade to either Drupal 7.27 or Drupal 6.31.</p>\n<h2>Known issues </h2>\n<ul><li>\nThis security release introduces small API changes which may require code updates on sites that expose Ajax or multi-step forms to anonymous users, and where the forms are displayed on pages that are cached (either by Drupal or by an external system).  See the <a href="http://drupal.org/drupal-7.27-release-notes">Drupal 7.27 release notes</a> and <a href="http://drupal.org/drupal-6.31-release-notes">Drupal 6.31 release notes</a> for more information.\n</li>\n<li>\n(Drupal 7 only) This release caused a JavaScript error which breaks Ajax requests in very old browsers (for example, Internet Explorer 8 and earlier); see <a href="https://drupal.org/node/2245331">this issue</a> for details.  The solution is to upgrade to <a href="https://drupal.org/drupal-7.28">Drupal 7.28</a>.\n</li>\n<li>\n(Drupal 7 only) This release caused the <a href="https://drupal.org/project/multiform">Multiple Forms</a> module to stop working correctly (see <a href="https://drupal.org/node/2247527">issue</a>).  The solution is to upgrade to <a href="https://www.drupal.org/node/2284027">Multiple Forms 7.x-1.1</a> or higher.\n</li>\n</ul><div style="clear: both; height: 1em;"></div>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/102">Drupal 6.x</a></div><div class="field-item odd"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1397678355', '2242651 at https://www.drupal.org'),
('11', '1', 'Drupal 7.28 released', 'https://www.drupal.org/drupal-7.28', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;"><em>Update: <a href="/drupal-7.29">Drupal 7.29</a> is now available.</em></p>\n<p style="position: inherit;">Drupal 7.28, a maintenance release with numerous bug fixes (no security fixes) is now available for download. See the <a href="http://drupal.org/drupal-7.28-release-notes">Drupal 7.28 release notes</a> for a full listing.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.28.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.28</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 sites is recommended.</strong> There are no major new features in this release. For more information about the Drupal 7.x release series, consult the <a href="http://drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 includes the built-in Update Manager module, which informs you about important updates to your modules and themes.</p>\n<p>There are no security fixes in this release of Drupal core.</p>\n<h2>Bug reports</h2>\n<p>Drupal 7.x is being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>), more maintenance releases will be made available, according to our <a href="http://drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.28 contains bug fixes and small API/feature improvements only. The full list of changes between the 7.27 and 7.28 releases can be found by reading the <a href="http://drupal.org/drupal-7.28-release-notes">7.28 release notes</a>. A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<h2>Update notes</h2>\n<p>See the <a href="http://drupal.org/drupal-7.28-release-notes">7.28 release notes</a> for details on important changes in this release.</p>\n<h2>Known issues </h2>\n<p>Changes made to the Update Manager module in this release may lead to performance slowdowns in certain cases (including on rare page loads for site visitors, if the site is using the automated cron feature). See the <a href="http://drupal.org/drupal-7.28-release-notes">release notes</a> for more information.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1399522773', '2261489 at https://www.drupal.org');
INSERT INTO `aggregator_item` VALUES
('12', '1', 'Community Spotlight on Emanuel Greucean, Maurits Dekkers, and Ernő Zsemlye', 'https://www.drupal.org/node/2271151', 'leighc', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>For this month’s community spotlight, we wanted to showcase three stellar Drupalistas who went above and beyond at the Dev Days Szeged sprints. Emanuel Greucean (<a href="https://drupal.org/user/829152" rel="nofollow">gremy</a>), Maurits Dekkers (<a href="https://drupal.org/user/2126610" rel="nofollow">Mauzeh</a>), and Ernő Zsemlye (<a href="https://drupal.org/user/262120" rel="nofollow">zserno</a>) all made big contributions to the project at <a href="http://drunomics.com/en/blog/drupal-dev-days-szeged-wrap" rel="nofollow">Dev Days Szeged</a>. Here’s a little bit about each.</p>\n<h2>Emanuel Greucean (<a href="https://drupal.org/user/829152" rel="nofollow">gremy</a>)</h2>\n<h3>How did you get involved with Drupal?</h3>\n<p><img src="/files/emanuel2.jpg" class="right" alt="Picture of Emanuel Greucean" />I got involved with Drupal right after college, in 2009. I went to a job interview, showed the employers my enthusiasm about web development and my very not impressive profile, one of which was a Joomla website, and they accepted me. At this job, I got initiated in the art of web development and got a solid education in Drupal. At my first day on the job, I was given the Drupal Developer’s “Bible”  (Pro Drupal Development, 2nd edition), and was told that I had to know it by heart.</p>\n<h3>What do you think open source represents?</h3>\n<p>For me, open source represents the opportunity to have access to awesome products for free. It also represents the opportunity to join a community of passionate developers and to learn a lot, and also to pass on your knowledge. If you are a contributor, it’s also an opportunity to leave a mark, and a joy to know that your work is being used by millions of people.</p>\n<h3>Why did you choose to work in Szeged on beta blocking, and what is your fondest memory from Szeged?</h3>\n<p>One reason for working on beta blockers in Szeged was the desire to get Drupal 8 as close as possible to being released, because I really want to start using it in Production.</p>\n<p>One of my fondest memories from Szeged might be the moment when I actually finished the last missing "Change Record” issue, and with this Drupal 8 change records were up to date for the first time in three years. Also I really appreciate all the help I received from people I had never met before. They initiated me into contributing to the community.</p>\n<h3>Are you working on any fun projects at the moment?</h3>\n<p>Yes. I am currently collaborating with Kalamuna, a Drupal shop from San Francisco''s East Bay Area. They are really great colleagues, and I have the opportunity to work on great projects with them. One of the projects I am most excited about is <a href="http://www.kalamuna.com/products/kalabox" rel="nofollow">Kalabox</a>, and I have to say that I am really enthusiastic about its future.</p>\n<h2>Maurits Dekkers (<a href="https://drupal.org/user/2126610" rel="nofollow">Mauzeh</a>)</h2>\n<h3>How did you get involved with Drupal?</h3>\n<p><img src="/files/1de0507.jpg" class="right" alt="Picture of Maurits Dekkers" />I got involved with Drupal through a client about three years ago. They were using Drupal mainly for its ability to allow site builders to create their own fieldable data structures. Until then I had mostly worked with Zend Framework and Symfony, and I never even knew there was an open source system that could do this! Or course, now I know that there is so much more about Drupal that is awesome, and I cannot imagine a web development life without it!</p>\n<h3>What do you think open source represents?</h3>\n<p>For me, open source represents people (!) who provide their time, effort, and financial resources on something that provides only indirect value. An open source developer spends their free time working on a feature not knowing whether it will actually make it into the final product (unless they are the project lead...). For some this might be an unrewarding way of working because there appear to be few direct, short-term, rewards. So if you contribute something to open source software, you must do it for reasons unrelated to direct income or revenue. Therefore, the passion that people have for the product comes from a much deeper belief.</p>\n<h3>Why did you choose to work in Szeged on Drupal 8 beta blocking/debugging, and what is your fondest memory from Szeged?<br /></h3>\n<p>Despite working with open source software on a daily basis, and lurking around in the issue queues, I never had the guts to really get involved. I realized that getting to know the people behind the nicknames would certainly help because I could just walk over and ask something. So when I saw the announcement for Szeged, I jumped in straight away. And I''m really glad I did. I most remember the people I was working with and having beers with at night, with Cathy (<a href="https://drupal.org/user/258568" rel="nofollow">YesCT</a>) being just amazing to get people up to speed. Her passion for the community is really remarkable. I wanted to learn more about how the Entity API works in Drupal 8, and was directed to <a href="https://drupal.org/user/107158" rel="nofollow">tstoeckler</a> and <a href="https://drupal.org/user/183211" rel="nofollow">plach</a>, from whom I learned very much very quickly.</p>\n<h3>Are you working on any fun projects at the moment?</h3>\n<p>I''m currently working as a freelancer for a few Drupal site building shops. Since I just started as a freelancer in November last year, I''m working quite a lot to make sure I have some financial room to contribute some more to D8.</p>\n<h2>Ernő Zsemlye (<a href="https://drupal.org/user/262120" rel="nofollow">zserno</a>)</h2>\n<h3> How did you get involved with Drupal?</h3>\n<p><img src="/files/IMG_0436_0.jpg" class="right" alt="Picture of Ernő Zsemlye" />It all started during my 4th year at the university. I needed a few more credits for the upcoming semester and stumbled upon a new elective course titled "Open Source Content Management Systems" held by a guy called <a href="https://drupal.org/user/55005 " rel="nofollow">Kristof Van Tomme</a>. I had absolutely no idea about the topic but it sounded pretty cool so I applied. The first lecture was about open source in general and a brief introduction to the Drupal world. At the end of the lecture, Kristof mentioned that he was looking for interns for his new company. I applied the next day and I am sure that was the best move in my career to date. :)</p>\n<h3>What do you think open source represents?<br /></h3>\n<p>I could compare it to traveling. Once you experience what traveling to new places feels like, you suddenly start to feel as if you had been looking at the world through a small and dirty window. Then you also realize how small you are in this life. This is so true for open source.</p>\n<h3>Why did you choose to work in Szeged on Drupal 8 beta blocking/debugging, and what is your fondest memory from Szeged?<br /></h3>\n<p>I wanted to work on something that would give me the opportunity to dive deep into Drupal 8 and learn as much as possible about the new system. I was assigned to an Entity API beta blocker. After having spent my first 3 days on getting my head around all the new things in D8, I got stuck. The next day <a href="https://drupal.org/user/214652" rel="nofollow">Berdir</a> pinged me on IRC that he wanted to discuss the next steps with me in person. We talked for about 5 minutes but that was enough to put me back on track with the issue and also gave me great inspiration that I could talk to a real rockstar in person.</p>\n<h3>Are you working on any fun projects at the moment?<br /></h3>\n<p>I am working at the Central European University as a web developer. We are a small team of four people who maintain virtually any web presence of the whole university: main institutional site with heavy traffic, custom websites for each departments, research groups, alumni campaigns, student groups, etc. It is a constant challenge to use our limited resources to address all arising needs successfully. So we are continuously looking for new ways to create reusable solutions across all these websites. And this is lots of fun. For example I just finished building a custom installation profile based on the fantastic <a href="https://drupal.org/project/panopoly" rel="nofollow">Panopoly</a> distribution so firing up a new website became ridiculously easy.</p>\n<p>---</p>\n<p>Gremy, mauzeh, and zserno were just a few of a huge number of rock stars who worked hard and made great contributions at Szeged. Thank you so much to everyone who turned out for the sprints! The next major sprint event will be at DrupalCon Austin. Our community organizers (led by <a href="https://drupal.org/user/258568" rel="nofollow">YesCT</a>) have worked hard to make sure we''ll have seven days of sprints that culminate in a huge sprint on <a href="https://austin2014.drupal.org/sprints" rel="nofollow">Friday, June 6</a>. We hope to see you there.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/20236">Drupal 8.x</a></div></div></div>', '1400601781', '2271151 at https://www.drupal.org'),
('13', '1', 'Drupal 6 extended support announcement', 'https://www.drupal.org/d6-lts-support', 'mlhess', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>On February 13, 2008, Drupal 6 was released.  The policy of the community is to  support only the current and previous stable versions.  (When Drupal 6 was released, Drupal 4.7.x was marked unsupported.  When Drupal 7 came out, Drupal 5.x was marked unsupported.) This policy was created to prevent core and module maintainers from having to maintain more than 2 active major versions of Drupal.</p>\n<p>With the coming Drupal 8 release, this policy has been questioned. We want to ensure that sites that wish to move from Drupal 6 to Drupal 8 have a supported window within which to do so. The Drupal core team, key module maintainers, and representatives of the Drupal security team met at Drupalcon Austin to discuss this as an in-person follow up to the previous discussion at <a href="https://drupal.org/node/2136029">https://drupal.org/node/2136029</a>.</p>\n<p><strong>Drupal 6 core and modules will transition to unsupported status three months after Drupal 8 is released. </strong>  "Unsupported status" means the community will not be providing support or patches in the same way we do now.  Continuing to support Drupal 6 would be difficult for many reasons, including a lack of automated test coverage, the requirement for rigorous manual release testing, the slow-down it introduces in the release of security fixes for the vast majority of Drupal users (on version 7+), and the general shift of volunteers in the community moving their attention onto Drupal 8 development.  </p>\n<p>This gives Drupal 6 users a few options:</p>\n<p>1) Upgrade to Drupal 7 any time between now and 3 months after Drupal 8.0.0 is released.  Drupal 7 releases undergo almost 40,000 automated tests, and Drupal 7 will be fully supported at least until Drupal 9 comes out. Given the past history, the release of Drupal 9 is likely to be around 2018. </p>\n<p>2) Upgrade to Drupal 8 after it is released, but before Drupal 6 is not supported anymore. Fortunately, <a href="https://drupal.org/node/2121299">Migrate support for Drupal 6 to Drupal 8 is already in core</a>, and there is  <a href="https://drupal.org/sandbox/mikeryan/2271813">Migrate UI</a>, a contributed module.  While not all contributed modules will be ready at the time Drupal 8 is released, Drupal 8''s migration path handles most of the critical site data via its CCK to Entities/Fields in Core migrations.</p>\n<p>3) Find an organization that will provide extended support for Drupal 6.  The Drupal Security Team will provide a method for companies and/or individuals to work together in the private security issue queue to continue developing updates, and will provide a reasonable amount of time for companies to provide patches to Drupal 6 security issues that also affect Drupal 7 or Drupal 8.  The security team will coordinate access to issues for companies wishing to provide extended support for Drupal 6.  However, the team will not explicitly review or test the patches (some team members may do this on their own). All code created by these vendors, would be released to the community.</p>\n<p>Organizations and individuals interested in providing this level of support for their customers<br /><strong>AND who have the technical knowledge to maintain a Drupal core release </strong>  should go to <a href="https://drupal.org/node/2287855">the security team Drupal 6 long term support</a> page.</p>\n<p>Both the Security Team and Drupal core leadership feel that a 3-month window after Drupal 8''s release before eclipsing community support for Drupal 6 is a workable compromise between leaving Drupal 6 sites on an unsupported version the second Drupal 8 comes out, and acknowledging that our community''s volunteer resources are limited and have shifted focus. We hope that organizations that rely on Drupal 6 will step up to help maintain it after community support winds down, and/or help their clients update to D8.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/102">Drupal 6.x</a></div></div></div>', '1403109723', '2288521 at https://www.drupal.org'),
('14', '1', 'Drupal 7.29 and 6.32 released', 'https://www.drupal.org/drupal-7.29', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;"><em>Update: <a href="/drupal-7.30">Drupal 7.30</a> and <a href="/drupal-7.31">Drupal 6.33</a> are now available.</em></p>\n<p style="position: inherit;">Drupal 7.29 and Drupal 6.32, maintenance releases which contain fixes for <strong>security vulnerabilities</strong>, are now available for download. See the <a href="https://www.drupal.org/drupal-7.29-release-notes">Drupal 7.29</a> and <a href="https://www.drupal.org/drupal-6.32-release-notes">Drupal 6.32</a> release notes for further information.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.29.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.29</span></a><br /><a href="http://ftp.drupal.org/files/projects/drupal-6.32.tar.gz" class="link-button"><span>Download Drupal 6.32</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 and 6 sites is strongly recommended.</strong> There are no new features or non-security-related bug fixes in these releases. For more information about the Drupal 7.x release series, consult the <a href="https://www.drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>. More information on the Drupal 6.x release series can be found in the <a href="https://www.drupal.org/drupal-6.0">Drupal 6.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 and 6 include the built-in Update Status module (renamed to Update Manager in Drupal 7), which informs you about important updates to your modules and themes.</p>\n<h2>Bug reports</h2>\n<p>Both Drupal 7.x and 6.x are being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>) more maintenance releases will be made available, according to our <a href="https://www.drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.29 is a security release only. For more details, see the <a href="https://www.drupal.org/drupal-7.29-release-notes">7.29 release notes</a>.  A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<p>Drupal 6.32 is a security release only. For more details, see the <a href="https://www.drupal.org/drupal-6.32-release-notes">6.32 release notes</a>.  A complete list of all bug fixes in the stable 6.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/6.x">the git commit log</a>.</p>\n<h2>Security vulnerabilities</h2>\n<p>Drupal 7.29 and 6.32 were released in response to the discovery of security vulnerabilities. Details can be found in the official security advisory:</p>\n<ul><li><a href="https://www.drupal.org/SA-CORE-2014-003">SA-CORE-2014-003</a></li>\n</ul><p>To fix the security problem, please upgrade to either Drupal 7.29 or Drupal 6.32.</p>\n<h2>Known issues </h2>\n<p>(Drupal 7 only) This release introduced a serious regression, the biggest effect of which is to cause files or images attached to taxonomy terms to be deleted when the taxonomy term is edited and resaved. See the <a href="https://www.drupal.org/drupal-7.29-release-notes">release notes</a> for more details. The solution is to upgrade to <a href="http://drupal.org/drupal-7.30">Drupal 7.30</a> or higher.</p>\n<div style="clear: both; height: 1em;"></div>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/102">Drupal 6.x</a></div><div class="field-item odd"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1405543076', '2304553 at https://www.drupal.org'),
('15', '1', 'Drupal 7.30 released', 'https://www.drupal.org/drupal-7.30', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;"><em>Update: <a href="/drupal-7.31">Drupal 7.31</a> is now available.</em></p>\n<p style="position: inherit;">Drupal 7.30, a maintenance release with several bug fixes (no security fixes), including a fix for regressions introduced in <a href="https://www.drupal.org/drupal-7.29">Drupal 7.29</a>, is now available for download. See the <a href="http://drupal.org/drupal-7.30-release-notes">Drupal 7.30 release notes</a> for a full listing.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.30.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.30</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 sites is recommended.</strong> There are no new features in this release. For more information about the Drupal 7.x release series, consult the <a href="http://drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 includes the built-in Update Manager module, which informs you about important updates to your modules and themes.</p>\n<p>There are no security fixes in this release of Drupal core.</p>\n<h2>Bug reports</h2>\n<p>Drupal 7.x is being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>), more maintenance releases will be made available, according to our <a href="http://drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.30 is a bug fix only release. The full list of changes between the 7.29 and 7.30 releases can be found by reading the <a href="http://drupal.org/drupal-7.30-release-notes">7.30 release notes</a>. A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<h2>Update notes</h2>\n<p>See the <a href="http://drupal.org/drupal-7.30-release-notes">7.30 release notes</a> for details on important changes in this release.</p>\n<h2>Known issues</h2>\n<p>None.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1406239971', '2309387 at https://www.drupal.org'),
('16', '1', 'Drupal 7.31 and 6.33 released', 'https://www.drupal.org/drupal-7.31', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;"><em>Update: <a href="/drupal-7.32">Drupal 7.32</a> and <a href="/drupal-7.34">Drupal 6.34</a> are now available.</em></p>\n<p style="position: inherit;">Drupal 7.31 and Drupal 6.33, maintenance releases which contain fixes for <strong>security vulnerabilities</strong>, are now available for download. See the <a href="https://www.drupal.org/drupal-7.31-release-notes">Drupal 7.31</a> and <a href="https://www.drupal.org/drupal-6.33-release-notes">Drupal 6.33</a> release notes for further information.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.31.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.31</span></a><br /><a href="http://ftp.drupal.org/files/projects/drupal-6.33.tar.gz" class="link-button"><span>Download Drupal 6.33</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 and 6 sites is strongly recommended.</strong> There are no new features or non-security-related bug fixes in these releases. For more information about the Drupal 7.x release series, consult the <a href="https://www.drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>. More information on the Drupal 6.x release series can be found in the <a href="https://www.drupal.org/drupal-6.0">Drupal 6.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 and 6 include the built-in Update Status module (renamed to Update Manager in Drupal 7), which informs you about important updates to your modules and themes.</p>\n<h2>Bug reports</h2>\n<p>Both Drupal 7.x and 6.x are being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>) more maintenance releases will be made available, according to our <a href="https://www.drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.31 is a security release only. For more details, see the <a href="https://www.drupal.org/drupal-7.31-release-notes">7.31 release notes</a>.  A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<p>Drupal 6.33 is a security release only. For more details, see the <a href="https://www.drupal.org/drupal-6.33-release-notes">6.33 release notes</a>.  A complete list of all bug fixes in the stable 6.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/6.x">the git commit log</a>.</p>\n<h2>Security vulnerabilities</h2>\n<p>Drupal 7.31 and 6.33 were released in response to the discovery of security vulnerabilities. Details can be found in the official security advisory:</p>\n<ul><li><a href="https://www.drupal.org/SA-CORE-2014-004">SA-CORE-2014-004</a></li>\n</ul><p>To fix the security problem, please upgrade to either Drupal 7.31 or Drupal 6.33.</p>\n<h2>Update notes</h2>\n<p>See the <a href="http://drupal.org/drupal-7.31-release-notes">7.31</a> and <a href="http://drupal.org/drupal-6.33-release-notes">6.33</a> release notes for details on important changes in this release.</p>\n<h2>Known issues</h2>\n<p>None.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/102">Drupal 6.x</a></div><div class="field-item odd"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1407346505', '2316639 at https://www.drupal.org'),
('17', '1', 'Introducing Drupal.org Terms of Service and Privacy Policy', 'https://www.drupal.org/news/introducing-drupalorg-tos-and-privacy-policy', 'tvn', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>UPDATE:<br />\nTerms of Service are now finalized and located at <a href="https://www.drupal.org/terms">https://www.drupal.org/terms</a>.<br />\nPrivacy Policy is now finalized and located at <a href="https://www.drupal.org/privacy">https://www.drupal.org/privacy</a></p>\n<hr /><p>Almost half a year ago, with the help of the <a href="https://www.drupal.org/governance/drupalorg-working-groups/content" rel="nofollow">Drupal.org Content Working Group</a> and lawyers, the Drupal Association started working on a Drupal.org Terms of Service (ToS) and Privacy Policy. After a number of drafts and rewrites, we are now ready to introduce both documents to Drupal.org users. </p>\n<h2>Why do we need a ToS?</h2>\n<p>Drupal.org has grown organically for many years. Currently the site has thousands of active users that generate lots of content every day. Our current Terms of Service are limited to a short line on the account creation form:</p>\n<blockquote><p>“Please note: All user accounts are for individuals. Accounts created for more than one user or those using anonymous mail services will be blocked when discovered.”</p></blockquote>\n<p>This line is an insufficient ToS for a website of our size. In fact, Drupal.org is probably the only website of this size which operates without a published Terms of Service. This situation is uncomfortable, and even dangerous, for both Drupal community and the Drupal Association, which is legally responsible for Drupal.org and its contents.</p>\n<p>In the absence of a ToS, a lot of rules—“do’s and don’ts”—regarding the website are just “common knowledge” of users who have a long memory and accounts created in the early days of Drupal.org. This might result in new users making mistakes and misbehaving only because they do not know what the unwritten rules are. Website moderators often lack guidance on how to react in specific situations, because those policies are not written anywhere. Some policies, such as <a href="https://www.drupal.org/node/1863498" rel="nofollow">organization accounts policy</a> or <a href="https://www.drupal.org/node/1289684" rel="nofollow">account deletion policy</a> still need to be defined. Lastly, absence of clearly defined Terms of Service and Privacy Policy could lead to legal disputes regarding the site.</p>\n<h2> What’s next?</h2>\n<p>The new Drupal.org Terms of Service and Privacy Policy are published now for the community review. We''ll continue refining them based on community feedback and announce the ''official'' implementation day additionally. On that day all existing users will have to accept these ToS and Privacy Policy to continue using the website. All new users starting on that day will have to accept the ToS and Privacy Policy upon account creation.</p>\n<p><a href="https://docs.google.com/a/association.drupal.org/document/d/1RouQqcurcyHGv7jdDT1C8RihDhbOiRMaBxD3FtCq0Ys/edit#" rel="nofollow">Click to review Drupal.org Terms of Service</a></p>\n<p><a href="https://docs.google.com/a/association.drupal.org/document/d/1ZRDPWaWB4wcBfyta3dF3GsgbVzeUW7VdGSLwv-fD93U/edit" rel="nofollow">Click to review Drupal.org Privacy Policy</a></p>\n<p>In the future, we will make sure to keep ToS and Privacy Policy up-to-date and update them every time policies or functionality of the website changes. We will proactively notify users of all modifications to both documents.</p>\n<h2>Thanks</h2>\n<p>We’d like to say thanks to the Drupal.org Content Working Group members and community members who already reviewed proposed documents and provided us with their valuable feedback.</p>\n<hr /><strong>UPDATE</strong>: Edits to the original drafts were made on 21st of August, 2014, based on feedback in comments to this post.\n<p><strong>UPDATE #2 (03.09.2014)</strong>:  We are postponing ToS/PP official launch and will come back with an updated draft shortly.</p>\n</div></div></div>', '1407505826', '2317953 at https://www.drupal.org'),
('18', '1', 'Maintainers can give credit to organizations that support Drupal projects', 'https://www.drupal.org/news/supporting-organizations-credit-on-profiles', 'joshuami', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>This week, we added a feature to projects on Drupal.org to help highlight the contributions made by supporting organizations. Maintainers of distributions, modules, and themes can give credit to organizations that have materially contributed to projects on Drupal.org using the new “Supporting Organizations” field.</p>\n<p><img src="/files/supporting-organizations-field.jpg" alt="Supporting organizations field" /></p><p>How do you use this field? When an organization funds the development of a project  or when a company takes on maintainership of a key module in the community, the maintainers of that project can add a reference to one or more of them on the project node. Maintainers may chose to give this credit to any organization that contributes significant code or support to a project.</p>\n<p>We noticed that many projects would manually follow this pattern in the project description, but wanted to take it a step further. Not only will this provide a link to the organization, it will also show up on the organization’s marketplace page.</p>\n<p><img src="/files/projects-supported.jpg" alt="Projects supported field on organization display" /></p><p>This is just the first step, we are also looking for community feedback and help in providing <a href="/node/2288727" rel="nofollow">credit to companies, organizations and customers that contribute to the development of Drupal</a>. Implementing this step will be a key way to show how organizations are giving code and support to Drupal Core.  Look for it in the coming months.</p>\n<p>Dries has written an excellent post on how we might <a href="http://buytaert.net/a-method-for-giving-credit-to-organizations-that-contribute-code-to-open-source" rel="nofollow">give credit to organizations</a> and another on the <a href="http://buytaert.net/the-investment-case-for-employing-a-drupal-core-contributor" rel="nofollow">value of hiring a core contributor</a> to help push Drupal forward that were a basis for much of this work.</p>\n<p>If you are a project maintainer, take a moment to give some credit to the organizations that have helped build the Drupal ecosystem.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/902">Drupal News</a></div></div></div>', '1409198997', '2328925 at https://www.drupal.org'),
('19', '1', 'Drupal Security Team update.', 'https://www.drupal.org/node/2340979', 'mlhess', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><h3>Joint Security release with WordPress</h3>\n<p>In big news, we had <a href="https://www.drupal.org/SA-CORE-2014-004" rel="nofollow"> our first joint release with WordPress</a>. We collaborated together with the WordPress team on a PHP security issue discovered by a security researcher. We’re thrilled that we had an opportunity to work together with others in the open source CMS community. We shared a few tips and tricks and it was great working with the WordPress team.</p>\n<h3>Keeping Drupal Secure</h3>\n<p>In keeping with our mission to showcase security best practices at Drupal’s online home, we’ve upgraded <a href="https://security.drupal.org">https://security.drupal.org</a> to Drupal 7. This ensures we’re on a supported platform.  We also took the opportunity to add some new features that help us enhance our team’s efficiency by automating a number of routine tasks.</p>\n<p>As part of our dedication to keeping Drupal users safe, we’ve written and announced the Long Term support (LTS) plan for Drupal 6 (<a href="https://www.drupal.org/d6-lts-support">https://www.drupal.org/d6-lts-support</a>). This is an important step as we look forward to the release of Drupal 8. Soon we will be introducing two-factor authentication to Drupal.org, thanks to hard work from security team members Ben Jeavons, Greg Knaddison , Neil Drumm, and Michael Hess. (<a href="https://groups.drupal.org/node/439868">https://groups.drupal.org/node/439868</a> and <a href="https://drupal.org/node/2239973">https://drupal.org/node/2239973</a>)</p>\n<p>And here’s one last, fun note: Security.Drupal.org issues now show up on the drupal.org dashboard if you add the widget. You can get it clicking on dashboard after logging in and adding the widget.</p>\n<p><img src="/files/dashsdo.png" /><br /></p><h3>Securing Drupal E-Commerce</h3>\n<p>Some Drupal security team members were recently involved in putting together a compliance <a href="http://drupalpcicompliance.org/" rel="nofollow"> White paper</a> for keeping track of PCI compliance. Anyone who runs a Drupal site and takes credit cards should read the whitepaper. Here’s a little more information:</p>\n<p>Version 3.0 of the PCI compliance standard becomes mandatory on January 1st, 2015 and will be a complete game changer for many Drupal eCommerce sites. This includes triple the number of security controls if your website touches credit card information and more. The community supported Drupal PCI Compliance White Paper (<a href="http://drupalpcicompliance.org/">http://drupalpcicompliance.org/</a>) will give you a high level overview of what PCI compliance is, why you need to comply, and (most importantly) how to get started. This paper was written and reviewed by several members of the Drupal security team, including Rick Manelius, Greg Knaddison, Ned McClain, Michael Hess, and Peter Wolanin.</p>\n<h3>Simplifying Security</h3>\n<p>We’ve redesigned our <a href="https://www.drupal.org/security" rel="nofollow"> Security Advisory system</a> to make evaluating and analyzing security threats easier and more intuitive. This came about after several core contributors informed us that they wanted a better way to address security threats. We sent out a survey through Twitter to learn more about how people write and read the Security Advisories. Based on the responses we put together a new Security Advisory system that takes much of the guesswork out of the process of evaluating threats. We’ve added and reordered elements on the Security Advisory’s criticality scale and added explanations to help people understand where a security problem is on the spectrum of potential threats. </p>\n<h3>Our Growing Team</h3>\n<p>We’ve brought a number of new members onto the security team. Please help us give a very warm welcome to our newest <a href="https://security.drupal.org/team-members" rel="nofollow">security team members:</a></p>\n<p>Alex Pott (alexpott) - IRC nick: alexpott, Organization: Chapter Three<br />\nCash Williams (cashwilliams) - IRC nick: CashWilliams, Organization: Acquia<br />\nDan Smith (galooph) - IRC nick: galooph, Organization: Code Enigma<br />\nDavid Snopek (dsnopek) - IRC nick: dsnopek, Organization: MVPcreator<br />\nRick Manelius (rickmanelius) - IRC nick: rickmanelius, Organization: NewMedia!</p>\n<p>We’re always looking for more qualified people who place a high priority on security. If you’d like to join the security team: <a href="https://security.drupal.org/join">https://security.drupal.org/join</a></p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1411063649', '2340979 at https://www.drupal.org'),
('20', '1', 'Drupal 8.0.0 beta 1 released', 'https://www.drupal.org/drupal-8.0.0-beta1', 'Dries', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><div class="messages warning">\nUpdate: The <a href="https://www.drupal.org/node/3060/release?api_version%5B%5D=7234">latest Drupal 8 beta release</a> is available with <strong>important security fixes</strong>.\n</div>\n<p><a href="https://www.drupal.org/node/2348025">Drupal 8.0.0-beta1</a> has just been released for testing and feedback! This key milestone is the work of over 2,300 people who have contributed more than 11,500 committed patches to 15 alpha releases, and especially the 234 contributors who fixed 177 "beta blocker" issues.  To read about the new features in Drupal 8, see <a href="https://www.drupal.org/drupal-8.0">Drupal.org''s Drupal 8 landing page</a>.</p>\n<!--break--><h3>Drupal 8 beta 1 for testers</h3>\n<p>Betas are good testing targets for developers and site builders who are comfortable reporting (and where possible, fixing) their own bugs, and who are prepared to rebuild their test sites from scratch if necessary. Beta releases are <em>not</em> recommended for non-technical users, nor for production websites.</p>\n<p>Start by <a href="http://ftp.drupal.org/files/projects/drupal-8.0.0-beta1.tar.gz">downloading Drupal 8.0.0-beta 1</a> and installing it!  Drupal 8 definitely still has bugs, and we need <em>your</em> help to discover them. Let us know what bugs you find in the <a href="https://www.drupal.org/project/issues/drupal">Drupal core issue queue</a>. (Please <a href="https://www.drupal.org/project/issues/search/drupal?version%5B%5D=8.x">search the known issues before filing</a>.)</p>\n<h3>Drupal 8 beta 1 for module and core developers</h3>\n<p>The main differences between the previous Drupal 8 alphas and the new beta are:</p>\n<ul><li>The fundamental APIs in Drupal 8 (like the entity, configuration, and menu APIs) are now stable enough so that contributed module and theme authors can start (or resume) their <a href="https://groups.drupal.org/node/430243">#D8CX pledges</a> and port their projects to Drupal 8.</li>\n<li>We have locked down Drupal 8''s data model enough that developers should generally not need to perform data migrations <em>between</em> beta releases of Drupal 8. We will start providing a beta-to-beta upgrade path in a later beta release.</li>\n<li>Limited API and data model changes <em>will</em> still happen, though core maintainers will try to isolate these changes to only non-fundamental APIs or critical bug fixes.</li>\n</ul><p>We need your help to fix <a href="https://www.drupal.org/project/issues/drupal?text=&amp;status=Open&amp;priorities=400&amp;categories=All&amp;version=8.x&amp;component=All">critical bugs</a> by <a href="https://www.drupal.org/patch/review">reviewing patches</a> and <a href="https://www.drupal.org/node/707484">creating patches</a>.</p>\n<p>If you''re new to core development, check out <a href="https://www.drupal.org/core-mentoring">Core contribution mentoring</a>, a twice-weekly <a href="https://www.drupal.org/irc">IRC meeting</a> where you can get one-on-one help getting set up and finding a Drupal 8 task.</p>\n<h3>Drupal 8 beta 1 for designers, translators, and documentation writers</h3>\n<p>Drupal 8''s user interface, interface text, and markup are not finalized until the first release candidate, so it''s too early to focus on user-facing documentation, translations, or themes (though by all means, adventurous contributors should start now to provide feedback while we can still fix things). Note that <a href="https://localize.drupal.org/translate">localize.drupal.org</a> does not yet support the full Drupal 8 API and does not have all translatable strings.</p>\n<h3>When does 8.0.0 get released?</h3>\n<p>Beta 1 will be followed by a series of additional beta releases with bug fixes, performance improvements, and improved stability.</p>\n<p>The release version of Drupal 8.0.0 will be ready after there are no more <a href="https://www.drupal.org/project/issues/drupal?text=&amp;status=Open&amp;priorities=400&amp;categories=All&amp;version=8.x&amp;component=All">critical issues</a> (as of today, there are 97 remaining) and we''ve had at least one <a href="https://www.drupal.org/core/release-cycle#rc">release candidate</a> (RC) without adding any more critical issues to the list.</p>\n<p>When will that be? "When it''s ready." The more people help, the faster we can find and fix bugs, and the faster 8.0.0 gets released. The faster 8.0.0 gets released, the faster we can <a href="https://www.drupal.org/node/2135189">start adding new features for Drupal 8.1.0</a>. So help out where you can, and let''s deliver the best release of Drupal ever! :)</p>\n<h3>Thank you!</h3>\n<p>A massive thank-you to everyone who helped get Drupal 8 beta 1 done, especially the contributors who have focused on beta-blocking issues (pictured below). </p>\n<p><img src="https://www.drupal.org/files/beta-blocker-tag-cloud.png" alt="Tag cloud of contributors to Drupal 8 beta blocker issues" /></p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/20236">Drupal 8.x</a></div></div></div>', '1412145034', '2348019 at https://www.drupal.org'),
('21', '1', 'Drupal 7.32 released', 'https://www.drupal.org/drupal-7.32', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;"><em>Update: <a href="/drupal-7.33">Drupal 7.33</a> is now available.</em></p>\n<p style="position: inherit;">Drupal 7.32, a maintenance release which contain fixes for <strong>security vulnerabilities</strong>, is now available for download. See the <a href="https://www.drupal.org/drupal-7.32-release-notes">Drupal 7.32</a> release notes for further information.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.32.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.32</span></a>\n</div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 is strongly recommended.</strong> There are no new features or non-security-related bug fixes in this release. For more information about the Drupal 7.x release series, consult the <a href="https://www.drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 and 6 include the built-in Update Status module (renamed to Update Manager in Drupal 7), which informs you about important updates to your modules and themes.</p>\n<h2>Bug reports</h2>\n<p>Both Drupal 7.x and 6.x are being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>) more maintenance releases will be made available, according to our <a href="https://www.drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.32 is a security release only. For more details, see the <a href="https://www.drupal.org/drupal-7.32-release-notes">7.32 release notes</a>.  A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<h2>Security vulnerabilities</h2>\n<p>Drupal 7.32 was released in response to the discovery of critical security vulnerabilities. Details can be found in the official security advisory:</p>\n<ul><li><a href="https://www.drupal.org/SA-CORE-2014-005">SA-CORE-2014-005</a></li>\n</ul><p>To fix the security problem, please upgrade to Drupal 7.32.</p>\n<h2>Known issues</h2>\n<p>None.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1413377258', '2357051 at https://www.drupal.org');
INSERT INTO `aggregator_item` VALUES
('22', '1', 'Next Steps for the Drupal.org Terms of Service and Privacy Policy', 'https://www.drupal.org/news/next-steps-for-drupalorg-tos-and-privacy-policy', 'tvn', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>UPDATE:<br />\nTerms of Service are now finalized and located at <a href="https://www.drupal.org/terms">https://www.drupal.org/terms</a>.<br />\nPrivacy Policy is now finalized and located at <a href="https://www.drupal.org/privacy">https://www.drupal.org/privacy</a></p>\n<hr /><p>Thanks to the hard work of staff and the Drupal.org Content Working Group, we have completed another round of updates to our draft privacy policy and terms of service. We were able to respond to much of the feedback provided in our <a href="https://www.drupal.org/news/introducing-drupalorg-tos-and-privacy-policy" rel="nofollow">earlier announcement</a>.</p>\n<p>The biggest issues pointed out by the community had to do with the tone of the language in the documents. Many pointed out that it did not match the values of our community. We took a closer look at organizations such as the <a href="https://wikimediafoundation.org/wiki/Terms_of_Use" rel="nofollow">Wikimedia Foundation</a> and <a href="https://www.mozilla.org/en-US/about/legal/terms/mozilla/" rel="nofollow">Mozilla</a>, incorporating some of the approaches they took to make our terms a bit more human. We trimmed and shortened what we could. We clarified where things were ambiguous. The end result is much more in line with our community values.</p>\n<p>Some examples of changes include the following:</p>\n<ul><li>When possible, we changed the tone of both documents to make them more friendly.</li>\n<li>We removed capital letters and used other means to make specific parts of the document noticeable.</li>\n<li>We deleted a couple of references to collecting data that we do not actually collect.</li>\n<li>We clarified that we won’t block accounts “for any and no reason”, but only in cases of Terms of Service, Code of Conduct and Git access policy violations.</li>\n<li>We clarified active notification of users about material changes to policy. We will send an email at least 72 hours prior to changes going into effect. This will give users time to delete their accounts if they don’t want to accept new policies.</li>\n<li>We added contact info and updated all phone numbers, addresses etc. to be formatted according to international standards.</li>\n<li>We clarified that you don’t need to create an account to access the Website, just some parts of it.</li>\n<li>We clarified how to notify us in case of unauthorized access to user account.</li>\n<li>We clarified how long do we store data after it has been removed from user profile.</li>\n</ul><p>We did leave some things from the previous draft without major changes, such as bullet points under section C, for example. And we did it for a reason. One of our goals is to make Drupal.org a place where everyone feels comfortable. Additionally, we have to ensure that Drupal.org is protected if a legal issue does arise. Those bullet points are there not because we want to be able to police or censor the activity on the site. This language exists because it protects Drupal.org if one user takes issue with content from another user. We will still use the process outlined in the Drupal Code of Conduct to resolve any issues whenever we can.</p>\n<p>With that in mind, please take a look at the latest drafts:</p>\n<p><a href="https://docs.google.com/document/d/1ec81NoUHw4OSrjBdh3LvlkG-2OySd7Qzgq_84DREPfQ/edit" rel="nofollow">Terms of Service</a><br /><a href="https://docs.google.com/document/d/17MOgC2V9OnpsJqdAxUJHSsSJGzn9w57HMI2i3erwXB8/edit" rel="nofollow">Privacy Policy</a></p>\n<p>We will be putting these documents into place on Wednesday, 5 November, 2014. All comments added to this thread will be included in our planning for the next revision. We hope to review the Terms of Service and Privacy Policy quarterly and update them with community feedback.</p>\n<p>Thank you for all your help in building these documents.</p>\n</div></div></div>', '1414588302', '2365505 at https://www.drupal.org'),
('23', '1', 'Drupal Core - Highly Critical - Public  Service announcement - PSA-2014-003', 'https://www.drupal.org/PSA-2014-003', 'Drupal Security Team', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><ul><li>Advisory ID: DRUPAL-PSA-2014-003</li>\n<li>Project: <a href="https://www.drupal.org/project/drupal">Drupal core</a>    </li>\n<li>Version: 7.x</li>\n<li>Date: 2014-October-29</li>\n<li>Security risk: <a href="https://www.drupal.org/security-team/risk-levels">25/25 (<span style="padding:1px;display:inline-block;background-color:#EC3E40;color:white"> Highly Critical</span>) AC:None/A:None/CI:All/II:All/E:Exploit/TD:All</a></li>\n</ul><!--break--><h2>Description</h2>\n<p>This Public Service Announcement is a follow up to <a href="https://www.drupal.org/SA-CORE-2014-005">SA-CORE-2014-005 - Drupal core - SQL injection</a>.  This is not an announcement of a new vulnerability in Drupal. </p>\n<p>Automated attacks began compromising Drupal 7 websites that were not patched or updated to Drupal 7.32 within hours of the announcement of <a href="https://www.drupal.org/SA-CORE-2014-005">SA-CORE-2014-005 - Drupal core - SQL injection</a>.  You should proceed under the assumption that every Drupal 7 website was compromised unless updated or patched before Oct 15th, 11pm UTC, that is 7 hours after the announcement.</p>\n<p><strong>Simply updating to Drupal 7.32 will not remove backdoors.</strong></p>\n<p>If you have not <a href="https://www.drupal.org/SA-CORE-2014-005">updated or applied this patch</a>, do so immediately, then continue reading this announcement; updating to version 7.32 or applying the patch fixes the vulnerability but does not fix an already compromised website. If you find that your site is already patched but you didn’t do it, that can be a symptom that the site was compromised - some attacks have applied the patch as a way to guarantee they are the only attacker in control of the site. </p>\n<h3>Data and damage control</h3>\n<p>Attackers may have copied all data out of your site and could use it maliciously.  There may be no trace of the attack.</p>\n<p>Take a look at our help documentation, <a href="https://www.drupal.org/node/2365547">”Your Drupal site got hacked, now what”</a></p>\n<h3>Recovery</h3>\n<p>Attackers may have created access points for themselves (sometimes called “backdoors”) in the database, code, files directory and other locations.  Attackers could compromise other services on the server or escalate their access.</p>\n<p>Removing a compromised website’s backdoors is difficult because it is not possible to be certain all backdoors have been found.</p>\n<p>The Drupal security team recommends that you consult with your hosting provider.  If they did not patch Drupal for you or otherwise block the SQL injection attacks within hours of the announcement of Oct 15th, 4pm UTC, restore your website to a backup from before 15 October 2014:</p>\n<ol><li>Take the website offline by replacing it with a static HTML page</li>\n<li>Notify the server’s administrator emphasizing that other sites or applications hosted on the same server might have been compromised via a backdoor installed by the initial attack</li>\n<li>Consider obtaining a new server, or otherwise remove all the website’s files and database from the server.  (Keep a copy safe for later analysis.)</li>\n<li>Restore the website (Drupal files, uploaded files and database) from backups from before 15 October 2014</li>\n<li>Update or patch the restored Drupal core code</li>\n<li>Put the restored and patched/updated website back online</li>\n<li>Manually redo any desired changes made to the website since the date of the restored backup</li>\n<li>Audit anything merged from the compromised website, such as custom code, configuration, files or other artifacts, to confirm they are correct and have not been tampered with.</li>\n</ol><p>While recovery without restoring from backup may be possible, this is not advised because backdoors can be extremely difficult to find.  The recommendation is to restore from backup or rebuild from scratch.</p>\n<p>For more information, please see our <a href="https://www.drupal.org/drupalsa05FAQ">FAQ on SA-CORE-2014-005</a>.</p>\n<h2> Written by</h2>\n<ul><li><a href="https://www.drupal.org/u/mlhess">Michael Hess</a> of the Drupal Security Team</li>\n<li><a href="https://www.drupal.org/u/Bevan">Bevan Rudge</a></li>\n</ul><h2>Coordinated by</h2>\n<ul><li><a href="https://www.drupal.org/u/mlhess">Michael Hess</a> of the Drupal Security Team</li>\n<li><a href="https://www.drupal.org/u/scor">Stéphane Corlosquet</a> of the Drupal Security Team</li>\n<li><a href="https://www.drupal.org/u/greggles">Greg Knaddison</a> of the Drupal Security Team</li>\n<li><a href="https://www.drupal.org/u/rickmanelius">Rick Manelius</a> of the Drupal Security Team</li>\n<li><a href="https://www.drupal.org/u/pwolanin">Peter Wolanin</a> of the Drupal Security Team</li>\n</ul><h2>Contact and More Information</h2>\n<p> We''ve prepared a FAQ on this release. Read more at <a href="https://www.drupal.org/drupalsa05FAQ">FAQ on SA-CORE-2014-005</a>.</p>\n<p>The Drupal security team can be reached at security at drupal.org or via the contact form at  <a href="https://www.drupal.org/contact">https://www.drupal.org/contact</a>.</p>\n<p>Learn more about <a href="https://www.drupal.org/security-team">the Drupal Security team and their policies</a>,  <a href="https://www.drupal.org/writing-secure-code">writing secure code for Drupal</a>, and  <a href="https://www.drupal.org/security/secure-configuration">securing your site</a>.\n </p>\n\n</div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1414593555', '2365563 at https://www.drupal.org'),
('24', '1', 'Strategic Initiatives for Drupal.org in 2015', 'https://www.drupal.org/news/drupalorg-strategic-initiatives-2015', 'joshuami', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>Drupal.org is an amazing installation of Drupal. At nearly 13 years old, it is one of the largest, continuously operating examples of Drupal. It is difficult to fathom, but Drupal.org has been upgraded in place from version to version for this entire timespan. I can think of no other site that has gone this long without a significant content and structure migration.</p>\n<p><a href="/ecosystem"><img src="https://docs.google.com/drawings/d/1Y7KkP0IgISsN8LuaAnJPKlxUxBe3883_oFS36It82vg/pub?w=300&amp;h=177" class="right" title="Drupal.org ecosystem, click for larger view" /></a></p>\n<p>Over the years, Drupal.org has grown from a single server owned by a contributor to multiple  racks at the OSL data center, plus cloud resources and content distribution networks spread across the globe. Drupal.org is more than a single site. There are over 20 services and subsites that make up the ecosystem that powers the Drupal community. Each month, over 20 TB of data passes through the Drupal.org infrastructure.</p>\n<p>With such a huge impact, it is important that we have a strong plan for the direction of Drupal.org. With that, we would like to introduce you to the <a href="/roadmap">Drupal.org Roadmap</a>.</p>\n<p><a href="/roadmap" class="link-button"><span>Drupal.org Roadmap</span></a></p>\n<p>Read on to find out how we set this strategic direction.</p>\n<h2>History</h2>\n<p>Volunteers built up these systems focusing on their passions with community initiatives. Many times these volunteers gave up days of their life - unpaid - to make sure that people could continue to build websites with Drupal and to build Drupal and its contributed projects. </p>\n<p>While the result is impressive, there are many areas of Drupal.org that received little or no attention in this model of development. If a developer burned out, or there was no one in the community with a passion for the area of needed improvements, that area remained unmaintained.</p>\n<p>For several years, the Drupal Association has funded the infrastructure that runs Drupal.org. The Association pays for the hosting facilities and the hardware to keep Drupal.org running. </p>\n<h2>The evolving role of the Drupal Association</h2>\n<p>In 2013, the Drupal Association board made the decision to begin building up an engineering team. This team would support both the infrastructure and software development activities behind Drupal.org. Our goal is to accelerate the development of the new features and to help build a cohesive roadmap so that Drupal.org would help unite a global community to build the best of the Web with Drupal. (Hint: that is the <a href="https://assoc.drupal.org/about">mission of the Drupal Association</a>.)</p>\n<p>Hired in March of 2014, the Drupal Association CTO was tasked with building a team and gathering feedback from Working Groups and the Board of Directors to set a strategic direction for Drupal.org.</p>\n<h2>Prioritizing the work</h2>\n<p>There are three primary working groups that guide the development of Drupal.org: Drupal.org Content Working Group (DCWG), Drupal.org Software Working Group (DSWG) and Drupal.org Infrastructure Working Group (DIWG).</p>\n<p>New development of features for the Drupal.org community of sites and services was determined through weeks of careful deliberation and research:</p>\n<ul><li>Previous years of feature ideation</li>\n<li>Working group feature ideation</li>\n<li>User research project</li>\n<li>Working group prioritization</li>\n<li>Board of Directors input and feedback</li>\n<li>Staff ideation on maintenance and performance improvements</li>\n</ul><p>One of the key influences in our prioritization process was the user research that was conducted during and after DrupalCon Austin in June of 2014. We interviewed over 30 individuals that represented a wide range of Drupal.org users from those that were just starting with Drupal, to longtime members of the community, and even those that had once used Drupal and had transitioned their careers to different technologies.</p>\n<p>This gave us four key areas in which to focus:</p>\n<h2>Sustaining support and maintenance</h2>\n<p>These efforts are the ongoing work that keeps the servers up and running and performing well. The <a href="/project/infrastructure">Drupal.org Infrastructure issue queue</a> is the primary place for this work, but there are several other related queues where staff and volunteers from the infrastructure team are focusing their work. Work that staff is tackling will be assigned to a staff member and tagged with d.o support.</p>\n<ul><li>Support for users: Drupal.org issue queues and email support</li>\n<li>Performance: uptime, page response, ongoing testbot deployments and maintenance</li>\n<li>Improving automated tests to make development and deployment reliable</li>\n<li>Maximize hardware and migrate to cloud services where appropriate</li>\n</ul><h2>Fund Drupal.org and future tools</h2>\n<p>While the majority of funds supporting Drupal.org come from our partner programs (Supporting Partner, Technology Partner, Hosting Partner), we are looking for ways to diversify where we raise funds.</p>\n<ul><li><a href="https://jobs.drupal.org/">Drupal Jobs</a></li>\n<li>DrupalCon websites (<a href="https://latinamerica2015.drupal.org/">Latin America</a>, <a href="https://losangeles2015.drupal.org/">Los Angeles</a>, <a href="https://barcelona2015.drupal.org/">Barcelona</a>, etc.)</li>\n<li><a href="http://drupalstore.org/">Drupal Store</a></li>\n<li><a href="https://assoc.drupal.org/advertising/web">Drupal.org advertising and partner program improvements</a></li>\n<li>Tools to help promote and add value to a <a href="https://assoc.drupal.org/membership">Drupal Association membership</a></li>\n</ul><h2>Board and Working Group Priorities: Drupal.org Staff Initiatives</h2>\n<p>These initiatives represent the work that Drupal Association technology and engineering staff will be focused on in the near term through 2015. By being focused on these initiatives, we will get the related features launched on Drupal.org faster. We will still need help to vet and test these features, so follow the issue tags you are interested in and get involved in the related issues.</p>\n<ul><li>Better account creation and login </li>\n<li>Organization and user profile improvements</li>\n<li>Responsive Redesign of Drupal.org</li>\n<li>Issue workflow and Git improvements</li>\n<li>Make Drupal.org Search Usable</li>\n<li>Improved tools to find and select projects</li>\n<li>Groups migration to Drupal 7</li>\n</ul><p>The <a href="/roadmap">Drupal.org Roadmap</a> provides much more detail about these key initiatives.</p>\n<h2>Community Initiatives</h2>\n<p>There is always more work to do on Drupal.org. We need committed and active volunteers to help with key initiatives that showed up in both our user research and the prioritization from the working groups. These are projects that we can support the efforts of contributors that have the time and skills to push these initiatives forward. Three examples with strong community leadership include:</p>\n<ul><li>Support localize.drupal.org</li>\n<li>Next generation testbots (DrupalCI)</li>\n<li>Two-factor authentication</li>\n</ul><h2>You can help</h2>\n<p>In addition to these initiatives, we would love to support a community member that would be willing to step up and lead an initiative to organize our Q&amp;A and support on Drupal.org. There is a huge need for people to be able to find answers to their Drupal questions. Stack Overflow fills part of this role, but there are many more opportunities on Drupal.org itself.</p>\n<p>We will also need a community driven effort to help us establish project ratings and reviews once these tools are in place. It will take a group effort to make these affective quickly.</p>\n<p>All of our initiatives need community involvement. Whether it is commenting on issues posted to these projects or joining in at sprints to move these initiatives forward, we can use your time and commitment.</p>\n<h2>Thank you</h2>\n<p>This planning and work would not have been possible without the financial support from our partners, the direction and leadership of the board, the time commitment of our Working Group members, and an incredibly dedicated Drupal Association staff. </p>\n<p>Cheers!</p>\n</div></div></div>', '1415057246', '2368565 at https://www.drupal.org'),
('25', '1', 'Drupal 7.33 released', 'https://www.drupal.org/drupal-7.33', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;"><em>Update: <a href="/drupal-7.34">Drupal 7.34</a> is now available.</em></p>\n<p style="position: inherit;">Drupal 7.33, a maintenance release with numerous bug fixes (no security fixes) is now available for download. See the <a href="https://www.drupal.org/drupal-7.33-release-notes">Drupal 7.33 release notes</a> for a full listing.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.33.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.33</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 sites is recommended.</strong> There are no major new features in this release. For more information about the Drupal 7.x release series, consult the <a href="https://www.drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 includes the built-in Update Manager module, which informs you about important updates to your modules and themes.</p>\n<p>There are no security fixes in this release of Drupal core.</p>\n<h2>Bug reports</h2>\n<p>Drupal 7.x is being maintained, so given enough <a href="https://www.drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://www.drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>), more maintenance releases will be made available, according to our <a href="https://www.drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.33 contains bug fixes and small API/feature improvements only. The full list of changes between the 7.32 and 7.33 releases can be found by reading the <a href="https://www.drupal.org/drupal-7.33-release-notes">7.33 release notes</a>. A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<h2>Update notes</h2>\n<p>See the <a href="https://www.drupal.org/drupal-7.33-release-notes">7.33 release notes</a> for details on important changes in this release.</p>\n<h2>Known issues </h2>\n<p>See the <a href="https://www.drupal.org/drupal-7.33-release-notes">7.33 release notes</a> for a list of known issues affecting this release.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1415374677', '2371107 at https://www.drupal.org'),
('26', '1', 'Drupal 7.34 and 6.34 released', 'https://www.drupal.org/drupal-7.34', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;">Drupal 7.34 and Drupal 6.34, maintenance releases which contain fixes for <strong>security vulnerabilities</strong>, are now available for download. See the <a href="https://www.drupal.org/drupal-7.34-release-notes">Drupal 7.34</a> and <a href="https://www.drupal.org/drupal-6.34-release-notes">Drupal 6.34</a> release notes for further information.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.34.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.34</span></a><br /><a href="http://ftp.drupal.org/files/projects/drupal-6.34.tar.gz" class="link-button"><span>Download Drupal 6.34</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 and 6 sites is strongly recommended.</strong> There are no new features or non-security-related bug fixes in these releases. For more information about the Drupal 7.x release series, consult the <a href="https://www.drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>. More information on the Drupal 6.x release series can be found in the <a href="https://www.drupal.org/drupal-6.0">Drupal 6.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 and 6 include the built-in Update Status module (renamed to Update Manager in Drupal 7), which informs you about important updates to your modules and themes.</p>\n<h2>Bug reports</h2>\n<p>Both Drupal 7.x and 6.x are being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>) more maintenance releases will be made available, according to our <a href="https://www.drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.34 is a security release only. For more details, see the <a href="https://www.drupal.org/drupal-7.34-release-notes">7.34 release notes</a>.  A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<p>Drupal 6.34 is a security release only. For more details, see the <a href="https://www.drupal.org/drupal-6.34-release-notes">6.34 release notes</a>.  A complete list of all bug fixes in the stable 6.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/6.x">the git commit log</a>.</p>\n<h2>Security vulnerabilities</h2>\n<p>Drupal 7.34 and 6.34 were released in response to the discovery of security vulnerabilities. Details can be found in the official security advisory:</p>\n<ul><li><a href="https://www.drupal.org/SA-CORE-2014-006">SA-CORE-2014-006</a></li>\n</ul><p>To fix the security problem, please upgrade to either Drupal 7.34 or Drupal 6.34.</p>\n<h2>Known issues</h2>\n<p>None.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/102">Drupal 6.x</a></div><div class="field-item odd"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', '1416422344', '2378319 at https://www.drupal.org'),
('27', '1', 'Call for Volunteers: Licensing Working Group', 'https://www.drupal.org/node/2387339', 'holly.ross.drupal', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>There are a growing number of licensing-related issues on Drupal.org that are unresolved. Additionally, volunteers who have been tackling licensing issues believe that the policies are often applied inconsistently. The result is that contributors are often left in a difficult situation, unsure if they should contribute their code or not, and the Drupal project is left at risk when non-compliant code is uploaded to Drupal.org.</p>\n<p>To solve this problem, several of the key volunteers met in July and determined that a Licesning Working Group, modeled after other Drupal and Drupal.org governance bodies and supported by training from the Drupal Association law firm, could provide more consistent oversight. At the 21 November meeting, the Drupal Association Board of Directors <a href="http://cgit.drupalcode.org/governance/plain/charters/licensing-working-group-charter.html" rel="nofollow">approved the draft charter</a> written by those volunteers.</p>\n<p>Now it''s your turn! We''re looking for 4-5 individuals to serve on the Working Group. You''ll receive lots of support from the Drupal Association when you need it, and you''ll be making a direct impact on the happiness of our contributors and the safety of the Drupal project. Just fill out the form below and we''ll get back to you. We expect to approve a slate of candidates during the 21 January board meeting. Questions? Email the Drupal Association Executive Director, Holly Ross, at <a href="mailto: holly@association.drupal.org" rel="nofollow">holly@association.drupal.org</a>.</p>\n<p><a class="link-button" href="https://assoc.drupal.org/licensing-working-group-self-nomination" rel="nofollow">Nominate Yourself!</a></p>\n<h3></h3>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/902">Drupal News</a></div></div></div>', '1417717836', '2387339 at https://www.drupal.org'),
('28', '1', 'Follow up on Drupal SA-2014-005, SQL Injection', 'https://www.drupal.org/node/2387517', 'mlhess', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>On October 29, the Drupal Security Team issued a Public Service Announcement (PSA) as a follow-up to Security Advisory <a href="https://www.drupal.org/SA-CORE-2014-005">SA-CORE-2014-005</a>, which disclosed a serious SQL Injection vulnerability in Drupal 7. Our goals with the PSA were to:</p>\n<ol><li>Provide an update on the time window between disclosure and first-known exploits</li>\n<li>Provide guidance for users who patched or upgraded outside that window</li>\n<li>Reiterate the severity of the vulnerability and the importance of upgrading or patching</li>\n</ol><p>(Speaking of which, if you have not remediated yet, please stop reading and do so.) </p>\n<p>While we feel those goals were accomplished, the PSA also resulted in a large volume of press coverage – in fact much more coverage than the original disclosure of the vulnerability on October 15th. Not surprisingly, the general tone of the press coverage was quite negative. Unfortunately, some of the coverage was also inaccurate which we’d like to address here as well as provide additional context regarding our security processes.</p>\n<p>While we don’t know the total number of Drupal sites affected, the number is not near 12 million as stated in several publications. Unless disabled, individual Drupal sites report their existence back to Drupal.org and this system reports around 1 million total Drupal sites. While this is not an exact measure of live Drupal sites we can infer that the affected number of specifically vulnerable Drupal 7 sites is more likely to be under 1 million.</p>\n<p>SA-CORE-2014-005 was certainly a severe issue, if not the most severe issue in Drupal’s history; but it’s important to recognize all software has bugs and security issues that require a remediation process. Finding, fixing and announcing security patches is evidence of a healthy security process and Drupal is one of the few content management systems with a dedicated <a href="https://www.drupal.org/security-team">security team</a> that covers both <a href="https://www.drupal.org/project/drupal">Drupal core</a> and contributed code.</p>\n<p>The above said, there are lessons from both the original disclosure and the follow-up PSA that might result in some changes to the Drupal Security Team policy and process, however we want to reinforce that we are deeply committed to keeping Drupal secure. We encourage you to read this <a href="http://drupalsecurityreport.org/">whitepaper </a> that explains our processes, policies and contains a good overview of Drupal security. </p>\n<p>If you ever have questions, please use the public discussion area for general topics at <a href="https://groups.drupal.org/security">https://groups.drupal.org/security</a> or contact us (<a href="mailto:security@drupal.org">security@drupal.org</a>). Or better yet, get involved. You can find more information on the <a href="/security-team">Drupal Security Team page. </a></p>\n<p>-Drupal Security Team</p>\n</div></div></div>', '1417733409', '2387517 at https://www.drupal.org'),
('29', '1', 'A Few Things to Unwrap on Drupal''s Birthday', 'https://www.drupal.org/news/drupal-birthday', 'tvn', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>Happy birthday to Drupal! On this day in 2001, Drupal 1.0 was released.</p>\n<p>This milestone is the perfect time to talk about some of the findings of our recent community survey. The survey findings offer a window into what community members are thinking as the project matures and evolves. It also gives us at the Drupal Association a way to better understand what we''re doing right and what we could be doing better. There aren''t many surprises (and that''s a good thing), but all of the findings are educational. Here are three results we thought were particularly interesting and insightful.</p>\n<h3>\n	Drupal 8 Will Be Broadly Adopted</h3>\n<p>\n	In the survey, about 80% of respondents said they either plan to start using Drupal 8 as soon as it is released, or plan to adopt it at some point after release. Another 8% said they did not have specific plans to adopt, but do plan to evaluate Drupal 8.</p>\n<p> </p>\n<p></p><center><br /><img alt="drupal8adoption" height="370" src="https://assoc.drupal.org/files/drupal8.png" width="500" /></center>\n<p> </p>\n<p> </p>\n<h3>\n	Drupal.org Remains an Important and Heavily-Used Tool</h3>\n<p>\n	The overwhelming majority of respondents said they use Drupal.org more than once per week. Most also say they are satisfied or somewhat satisfied with the site. While that result is encouraging, it does not change the important mission to improve the experience of the site and make it a better tool for everyone from first time visitors to those who spend the majority of their working time on the site.</p>\n<p> </p>\n<p> </p>\n<p></p><center><br /><img alt="dosatisfaction" height="370" src="https://assoc.drupal.org/files/dosatisfaction.png" width="500" /></center>\n<p> </p>\n<p> </p>\n<h3>\n	We Need to Create Broader Awareness of Drupal Association Programs</h3>\n<p>\n	Community members who took the survey have great awareness of DrupalCons. Awareness of the work we are doing on Drupal.org seems to be steadily growing. But awareness is relatively low for Community Grants and our Supporter Programs that provide a way for organizations to give back to the Project. That awareness is clearly something we need to improve to promote transparency.</p>\n<p> </p>\n<p> </p>\n<p></p><center><br /><img alt="awareness" height="466" src="https://assoc.drupal.org/files/awareness.png" width="500" /></center>\n<p> </p>\n<p> </p>\n<p>If you would like to read the full results, <a href="https://assoc.drupal.org/files/Drupal2014CommunitySurvey.pdf">you can access them here</a> (2.8M PDF). Thanks for reading, and thanks for being a part of this amazing community.</p>\n<p> </p>\n</div></div></div>', '1421340556', '2408709 at https://www.drupal.org'),
('30', '1', 'Predictions for 2015', 'https://www.drupal.org/node/2409893', 'bertboerland', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>Now the new year has started, it''s time for our community to think about the future. It has become a tradition for  for years now to predict what the year ahead will bring for us -- so share your thoughts!</p>\n<p>It''s time to reflect on our <a href="https://www.drupal.org/node/2173123" rel="nofollow">previous</a> predictions and start dreaming away for the year ahead.  What will the year ahead bring for our community and our product, and how can we make this reality by working together? Share your thoughts and your predictions for 2015 as a comment,  and let''s look back in a year''s time to see how we scored on making those dreams a reality.</p>\n<p>Previous predictions: <a href="https://drupal.org/node/14784" rel="nofollow">2005</a>, <a href="https://drupal.org/node/41966" rel="nofollow">2006</a>, <a href="https://drupal.org/node/105423" rel="nofollow">2007</a>, <a href="https://drupal.org/node/204454" rel="nofollow">2008</a>, <a href="https://drupal.org/node/356251" rel="nofollow">2009</a>, <a href="https://drupal.org/node/671566" rel="nofollow">2010</a>, <a href="https://drupal.org/node/1028810" rel="nofollow">2011</a>, <a href="https://drupal.org/node/1399054" rel="nofollow">2012</a>, <a href="https://drupal.org/node/1881074" rel="nofollow">2013</a>, <a href="https://www.drupal.org/node/2173123" rel="nofollow">2014</a>.</p>\n</div></div></div>', '1421616805', '2409893 at https://www.drupal.org');
