('29', '19', 'center', 'custom', 'custom', '1', 'a:0:{}', 'a:5:{s:11:"admin_title";s:0:"";s:5:"title";s:9:"HTML Tags";s:4:"body";s:2566:"<h6>Paragraph</h6>\n<p>n viverra, velit eu feugiat gravida, est magna bibendum diam, et rhoncus mi diam non turpis. Morbi sapien urna, molestie in dui id, blandit blandit lacus. Pellentesque at ultrices purus, eget egestas enim. Donec elementum convallis velit, gravida gravida elit posuere vestibulum. Curabitur diam est, tincidunt ac tempor non, sodales ac sem. Morbi porttitor nisi est, in tempor libero commodo ut. Curabitur a mauris et odio faucibus imperdiet a quis nunc. </p>\n\n<h6>Address Tag</h6>\n<address>1 Infinite Loop\nCupertino, CA 95014\nUnited States</address><br>\n\n<h6>Anchor Tag (aka. Link)</h6>\nThis is an example of a <a href="#" tytle="Link">link</a>\n\n<h6>Abbreviation Tag</h6>\nThe abbreviation <abbr title="Seriously">srsly</abbr> stands for “seriously”\n\n<h6>Bi-Directional Override Tag</h6>\nThis text will go left to right.\n<bdo dir="rtl">This text will go right to left.</bdo>\n\n<h6>Code Tag</h6>\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\n\n<h6>Definition Tag</h6>\n<dfn>HTML</dfn> is the standard markup language for creating web pages.\n\n<h6>Delete Tag</h6>\nThis tag will let you <del>strikeout text</del>.\n\n<h6>Emphasize Tag</h6>\nThe emphasize tag should <em>italicize</em> text.\n\n<h6>Insert Tag</h6>\nThis tag should denote <ins>inserted</ins> text.\n\n<h6>Keyboard Tag</h6>\nThis scarcely known tag emulates <kbd>keyboard text</kbd>.\n\n<h6>Marked Text Tag</h6>\nThe &lt;mark&gt; element is used to <mark>highlight</mark> text.\n\n<h6>Preformatted Tag</h6>\nThis tag styles large blocks of code.\n<pre>.post-title {\n  margin: 0 0 5px;\n  font-weight: bold;\n  font-size: 38px;\n  line-height: 1.2; and here''s a line of some really, really, really, really long text, just to see how the PRE tag handles it and to find out how it overflows;\n}</pre>\n\n<h6>Quote Tag</h6>\n<q>Developers, developers, developers…</q> – Steve Ballmer.\n\n<h6>Sample Output Tag</h6>\nRegular text. <samp>This is sample text.</samp> Regular text.\n\n<h6>Smaller text</h6>\nThis is the first sentence.  <small>This whole sentence is in small letters.</small>\n\n<h6>Strong Tag</h6>\nThis tag shows <strong>bold text.</strong>\n\n<h6>Subscript Tag</h6>\nGetting our science styling on with H<sub>2</sub>O, which should push the “2” down.\n\n<h6>Superscript Tag</h6>\nStill sticking with science and Isaac Newton’s E = MC<sup>2</sup>, which should lift the 2 up.\n\n<h6>Time Tag</h6>\nI have a date on <time datetime="2008-02-14 20:00">Valentines day</time>.\n\n<h6>Variable Tag</h6>\nThis allows you to denote <var>variables</var>.";s:6:"format";s:9:"full_html";s:10:"substitute";b:1;}', 'a:0:{}', 'a:1:{s:8:"settings";N;}', 'a:0:{}', 'a:0:{}', 2, 'a:0:{}', 'cc192944-55ee-4f21-ae48-78d5b5f43767'),
