('57', '19', 'content_3', 'custom', 'custom', '1', 'a:0:{}', 'a:5:{s:11:"admin_title";s:0:"";s:5:"title";s:5:"Forms";s:4:"body";s:2096:"<form>\n	<div class="clearfix">\n		<div class="col-1-2">\n			<fieldset>\n				<legend>Input</legend>\n				<p><label for="#text">Label</label></p>\n				<p><input id="text" placeholder="Name" type="text"></p>\n				<p><input id="text" placeholder="E-mail" type="email"></p>\n				<input placeholder="Password" type="password">\n			</fieldset>\n		</div>\n		<div class="col-1-2 col-last">\n			<fieldset>\n				<legend>Select</legend>\n				<p>\n					<select>\n						<option value="opt1" selected="">Option 1</option>\n						<option value="opt2">Option 2</option>\n						<option value="opt3">Option 3</option>\n					</select>\n				</p>\n				<p>\n					<select>\n						<optgroup label="Group 1">\n							<option value="opt1" selected="">Option 1</option>\n							<option value="opt2">Option 2</option>\n							<option value="opt3">Option 3</option>\n						</optgroup>\n						<optgroup label="Group 2">\n							<option value="opt4">Option 4</option>\n							<option value="opt5">Option 5</option>\n							<option value="opt6">Option 6</option>\n						</optgroup>\n					</select>\n				</p>\n				<select multiple="" size="3">\n					<option value="opt1" selected="">Option 1</option>\n					<option value="opt2">Option 2</option>\n					<option value="opt3">Option 3</option>\n				</select>\n			</fieldset>\n		</div>\n	</div>\n	<div class="clearfix">\n		<div class="col-1-2">\n			<fieldset>\n				<legend>Radio</legend>\n				<p><input name="radio" value="radio1" checked="" type="radio">Option 1</p>\n				<p><input name="radio" value="radio2" type="radio">Option 2<br></p>\n				<input name="radio" value="radio3" type="radio">Option 3\n			</fieldset>\n		</div>\n		<div class="col-1-2 col-last">\n			<fieldset>\n				<legend>Checkbox</legend>\n				<p><input value="check1" checked="" type="checkbox">Option 1</p>\n				<p><input value="check2" type="checkbox">Option 2</p>\n				<input v